import avatarCard from "../images/avatar.gif";

function Info() {
    return (
        <div>
            <img
                src={avatarCard}
                alt="Avatar"
                className="info--avatar_icon"
            />
            <h1 className="info--cardName">Isaac Gomes</h1>
            <h4 className="info--role">Frontend developer & Computer Science student</h4>
        </div>
    )
}

export default Info;
